require_relative '../../../leetcode/isomorphic-strings/isomorphic_strings.rb'

describe "Isomorphic Strings" do
  subject { LeetCode::IsomorphicStrings.new }

  context "site examples" do
    # Input: s = "egg", t = "add"
    # Output: true
    it "should return true when s = 'egg' and t = 'add'" do
      expect(subject.is_isomorphic('egg', 'add')).to eql(true)
    end

    # Input: s = "foo", t = "bar"
    # Output: false
    it "should return false when s = 'foo' and t = 'bar'" do
      #   f      o       o
      #   b      a       r
      # (f->b) (o->a) (o->r)*
      expect(subject.is_isomorphic('foo', 'bar')).to eql(false)
    end

    # Input: s = "paper", t = "title"
    # Output: true
    it "should return true when s = 'paper' and t = 'title'" do
      #   p      a       p     e      r
      #   t      i       t     l      e
      # (p->t) (a->i) (p->t) (e->l) (r->e)
      expect(subject.is_isomorphic('paper', 'title')).to eql(true)
    end

    it "should return false when s = 'badc' and t = 'baba'" do
      # badc
      # baba
      #   b      a       d      c
      #   b      a       b      a
      # (b->b) (a->a) (d->b)* (c->a)
      expect(subject.is_isomorphic('badc', 'baba')).to eql(false)
    end

